    public static String getRoad() {  
        int index=getNum(0,road.length-1);  
        String second=road[index];

        switch( index % 4 ) {
          case 0:
            second += " St ";
          break;
          case 1:
            second += " Dr ";
          break;
          case 2:
            second += " Blvd ";
          break;
          default:
            second += " Rd ";
          break;
        }

        String first=String.valueOf(getNum(11,150))+" ";  
        String third= cityArray[index%cityArray.length];
        return first+second+third;  
    }  
    
